import React from "react";

function Stream() {
  return (
    <div>
      <div className="stream-image" />
      <h4>Display name</h4>
      <p>Name of Game</p>
      <p>Number of viewers</p>
      <p>Description</p>
    </div>
  );
}

export default Stream;
